  const URL = process.env.REACT_APP_API_URL;

  return (
    <tr className='gameDivContainer'>
      {console.log('Hi my name is Bob' + videoGame)}
      <td className='gameName'>{videoGame?.name}</td>
      <td className='gameGenre'>{videoGame?.genre}</td>
      <td className='gamePlatforms'>{videoGame?.platforms}</td>
      <td className='gameESRB'>{videoGame?.esrb_rating}</td>
      <td className='gamePrice'>{videoGame?.price}</td>
      <td className='gameAbout'>{videoGame?.about}</td>
    </tr>
  );
}

export default VideoGames;
